import React, { Component } from 'react';
import GameCard from "./Components/GameCard/GameCard";
import './App.css';
import cards from "./cards.json";

class App extends Component {

  state = {
    cards
  };

  render() {
    return (
      <div className="App">
        {this.state.cards.map(card => (
          <GameCard
            id={card.id}
            image={card.image}
            name={card.image}
          />
        ))}
      </div>
    );
  }
}

export default App;
